		"<b>來自法國的紅藍白軍團</b>\n\nÉquipe cycliste Groupama-FDJ如今能夠與全世界最優秀的隊伍在頂尖賽場上競爭，主要是因為他們完整保留傳統的法國哲學與精神。作為帶有法國國旗象徵的隊伍，每個自行車手都會全心全意地爭取三色冠軍衫。\n\n在1997年賽季初，由兩位滿懷熱情的退役選手Marc和Yvon Madiot，一同創立了Équipe cycliste Française des Jeux。2018年是車隊的轉類點，Groupama加入成為冠名贊助商之一。這兩個法國體育界的主要推動者催生了Équipe cycliste Groupama-FDJ，在為車隊取得更多資源的同時延續其強大的團隊意識與精神。26年來車隊贏得500多場勝利，其中包括13次法國國家冠軍、3個Monuments of cycling以及38個Grand Tour單站冠軍。",
