		"<b>職業選手參與製作的高性能訓練衫</b>\n\n職業選手參與製作的高性能訓練衫，以舒適為最優先考量，能夠符合各種不同的身形。\n整件衣服輕盈透氣，正面與背面均使用具有微透氣孔的Light Point布料，親膚柔軟，如呼吸般順暢的透氣。在身體側邊加入極透氣的柔軟網狀布料Rip Pro Air，將透氣性再提升一個檔次。\n\n袖子使用Skin 120並採用毛邊剪裁，讓它同時具備服貼、舒適以及空氣力學。低領設計更符合低風阻騎姿，整體剪裁考慮了人體工學能大幅度減少皺褶，下擺加入止滑矽膠讓運動時衣服不會產生位移。隱藏式的全開拉鍊使外觀看起來更簡潔，而且製作的比以往更堅固、更容易拉動，讓您能夠輕鬆地隨時調節體溫。在重點部位加入反光條，提升在道路上的能見度。",
