		"<b>經典老牌的藍色勁旅</b>\n\n在世界頂級的職業自行車賽UCI WorldTour中，營運時間最長且成功的冠軍車隊。\n\n2023年，這個藍色隊伍已完成了44個賽季，今後也將繼續活躍於自行車的頂尖賽場。為了讓不分性別的優秀選手都能夠有發揮的舞台，於2018年增設女子隊，並且是UCI Women's WorldTour最高級別賽事的一份子。",
